// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { CartProvider } from './context/CartContext';
import { AuthProvider, useAuth } from './context/AuthContext';
import Hero from './components/Hero';
import Clubs from './components/Clubs';
import Pricing from './components/Pricing';
import Cafe from './components/Cafe';
import CombinedLayoutBooking from './components/CombinedLayoutBooking';
import BookingConfirmation from './components/BookingConfirmation';
import AdminPanel from './components/AdminPanel';
import MyBookings from './components/MyBookings';
import Login from './components/Login';
import './styles/App.css';
import Rooms from './components/Rooms';

// Защита: только админ
const AdminOnlyRoute = () => {
  const { user, loading } = useAuth();

  if (loading) return <div>Загрузка...</div>;
  if (!user || user.role !== 'admin') return <Navigate to="/login" replace />;
  
  return <AdminPanel />;
};

// Защита: только обычный пользователь (и редирект админа)
const UserOnlyRoute = ({ children }) => {
  const { user, loading } = useAuth();

  if (loading) return <div>Загрузка...</div>;

  // Если админ пытается попасть на главную — кидаем в админку
  if (user && user.role === 'admin') {
    return <Navigate to="/admin" replace />;
  }

  // Если не авторизован — на логин
  if (!user) {
    return <Navigate to="/login" replace />;
  }

  return children;
};

// Главная страница (только для обычных пользователей)
const HomePage = () => {
  return (
    <>
      <Hero />
    </>
  );
};

// Обёртка для маршрутов приложения
function AppContent() {
  const { user, loading } = useAuth();

  if (loading) {
    return <div className="app-loading">Загрузка...</div>;
  }

  if (user) {
    if (user.role === 'admin') {
      return (
        <Routes>
          <Route path="/admin" element={<AdminPanel />} />
          <Route path="*" element={<Navigate to="/admin" replace />} />
        </Routes>
      );
    } else {
      return (
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/clubs" element={<Clubs />} />
          <Route path="/rooms/:clubId" element={<Rooms />} />
          <Route path="/booking" element={<CombinedLayoutBooking />} />
          <Route path="/confirmation" element={<BookingConfirmation />} />
          <Route path="/my-bookings" element={<MyBookings />} />
          <Route path="/admin" element={<Navigate to="/" replace />} />
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      );
    }
  }

  // Не авторизован — только страница входа
  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="*" element={<Navigate to="/login" replace />} />
    </Routes>
  );
}

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <Router>
          <div className="App">
            <AppContent />
          </div>
        </Router>
      </CartProvider>
    </AuthProvider>
  );
}

export default App;
